import React from 'react';
import Chart from './Chart';
import Card from './DetailCard';
import News from './DetailPageRecentInfoList'
import { useState, useEffect } from 'react';

const axios = require('axios');

function DetailPage({match}) {
    const [coinData, setCoinData] = useState({})

    const coinId = match.params.ticker
    console.log(match);
    useEffect(() => {
        axios.get(`http://54.180.16.31:5000/api/search/detail/${coinId}`)
            .then((response) => {
                console.log(response);
                setCoinData(response);
            }).catch((error) => {
                console.log(error);
            });
    }, [])
    return (
        <div style={{backgroundColor:"rgb(243,242,246)", width:'100vw', height:'80vh',overflow:'auto'}}>
            <Card></Card>
            <Chart></Chart>
            <div>
                <News></News>
            </div>
        </div>
    );
}

export default DetailPage
